import website from '../src/img/web.png';
import Android from '../src/img/web.png';
import IOS from '../src/img/web.png';
import Software from '../src/img/web.png';
import Digital from '../src/img/web.png';
import App from '../src/img/web.png';

const Sdata = [
    {
        imgsrc: website,
        title: "Web development",
    },
    {
        imgsrc: Android,
        title: "Android Development",
    },
    {
        imgsrc: IOS,
        title: "IOS Development",
    },
    {
        imgsrc: Software,
        title: "Software Development",
    },
    {
        imgsrc: Digital,
        title: "Digital Marketing",
    },
    {
        imgsrc: App,
        title: "App Development",
    }
]
export default Sdata;
